import React from "react";
import ReactDOM from "react-dom/client";
import "./style.css";

function App() {
  return <div className="card">A</div>;
}

function Avatar() {}

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
